import React from "react";
import "../../../Styles/Pages/ToSell/ToSellThird.scss";

function ToSellThird() {
  return (
    <div className='toSellThird'>
      <div className='toSellThird__left'>
        <h1>Get ready for global online sales.</h1>
        <p>
          We enable merchants to accept mobile and online payments from buyers
          worldwide. Our payment processing is seamless, safe, and reliable, no
          matter where you are on the map . You'll have access to a Commerce
          Dashboard, which provides instant insights into your sales and
          customer health metrics.
        </p>
      </div>
      <div className='toSellThird__right'></div>
    </div>
  );
}

export default ToSellThird;
